PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime, "two_factor_secret" text, "two_factor_recovery_codes" text, "two_factor_confirmed_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "restore_operations" ("id" integer primary key autoincrement not null, "backup_operation_id" integer not null, "destination_connection_id" integer not null, "destination_config" text not null, "status" varchar check ("status" in ('pending', 'running', 'completed', 'failed', 'cancelled')) not null, "started_at" datetime, "completed_at" datetime, "error_message" text, "created_at" datetime, "updated_at" datetime, foreign key("backup_operation_id") references "backup_operations"("id"), foreign key("destination_connection_id") references "connections"("id"));
CREATE TABLE IF NOT EXISTS "job_logs" ("id" integer primary key autoincrement not null, "loggable_type" varchar not null, "loggable_id" integer not null, "level" varchar check ("level" in ('info', 'warning', 'error')) not null, "message" text not null, "context" text, "created_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "connections" ("id" integer primary key autoincrement not null, "name" varchar not null, "type" varchar check ("type" in ('s3', 'mongodb', 'google_drive', 's3_destination', 'local_storage')) not null, "credentials" text not null, "is_active" tinyint(1) not null default '1', "last_validated_at" datetime, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "backup_schedules" ("id" integer primary key autoincrement not null, "name" varchar not null, "source_connection_id" integer not null, "destination_connection_id" integer not null, "cron_expression" varchar not null, "frequency_preset" varchar, "is_active" tinyint(1) not null default '1', "last_run_at" datetime, "next_run_at" datetime, "last_run_status" varchar, "success_count" integer not null default '0', "failure_count" integer not null default '0', "created_at" datetime, "updated_at" datetime, foreign key("source_connection_id") references "connections"("id") on delete cascade, foreign key("destination_connection_id") references "connections"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "backup_operations" ("id" integer primary key autoincrement not null, "source_connection_id" integer not null, "destination_connection_id" integer not null, "status" varchar not null, "archive_path" varchar, "archive_size" integer, "metadata" text, "started_at" datetime, "completed_at" datetime, "error_message" text, "created_at" datetime, "updated_at" datetime, "backup_schedule_id" integer, foreign key("destination_connection_id") references connections("id") on delete no action on update no action, foreign key("source_connection_id") references connections("id") on delete no action on update no action, foreign key("backup_schedule_id") references "backup_schedules"("id") on delete set null);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE INDEX "restore_operations_status_index" on "restore_operations" ("status");
CREATE INDEX "job_logs_loggable_type_loggable_id_index" on "job_logs" ("loggable_type", "loggable_id");
CREATE INDEX "job_logs_created_at_index" on "job_logs" ("created_at");
CREATE INDEX "connections_temp_type_index" on "connections" ("type");
CREATE INDEX "connections_temp_is_active_index" on "connections" ("is_active");
CREATE INDEX "backup_schedules_is_active_index" on "backup_schedules" ("is_active");
CREATE INDEX "backup_schedules_next_run_at_index" on "backup_schedules" ("next_run_at");
CREATE INDEX "backup_operations_created_at_index" on "backup_operations" ("created_at");
CREATE INDEX "backup_operations_status_index" on "backup_operations" ("status");
COMMIT;
